from fastapi import FastAPI, Request
from pydantic import BaseModel
from fastapi.responses import JSONResponse

app = FastAPI()

class ProofData(BaseModel):
    block_number: int
    proof: str

@app.get("/next-block")
def get_next_block():
    return {
   "block_number": 5,
   "block_data": ""
}

@app.post("/submit-proof")
async def submit_proof(data: ProofData):
    print(f"Received proof: {data}")
    return JSONResponse(content={"result": "0x1234"}, status_code=200)

if __name__ == "__main__":
    import uvicorn
    uvicorn.run("main:app", host="127.0.0.1", port=3124, reload=True)

